import Header from "../Header/Header";

const Profile = ({ loggedIn }) => {
  return (
    <div className="profile">
      <Header loggedIn={loggedIn} />
      <h2 className="profile__title">Привет, Виталий!</h2>
      <div className="profile__info">
        <p className="profile__info-text">Имя</p>
        <p className="profile__info-text">Виталий</p>
      </div>
      <div className="profile__info">
        <p className="profile__info-text">E-mail</p>
        <p className="profile__info-text">pochka@yandex.com</p>
      </div>
      <button className="profile__btn profile__btn-edit">Редактировать</button>
      <button className="profile__btn profile__btn-out">
        Выйти из аккаунта
      </button>
    </div>
  );
};

export default Profile;
